// https://www.hackerrank.com/challenges/palindrome-index/problem?utm_campaign=challenge-recommendation&utm_medium=email&utm_source=24-hour-campaign

$debug = $argv[1] ?? false;

$method = 'palindromeIndex';


function palindromeIndex($s): int
{
    global $debug;
    $index = -1;

    $debug && printf('string length %d' . PHP_EOL, strlen($s));

    if ($s == strrev($s)) {
        return -1;
    }

    if (substr($s, 1) == strrev(substr($s, 1))) {
        return 0;
    }

    $stringLen = strlen($s);

    for($i=0; $i<$stringLen; $i++) {

        if ($i == 0) {
            $testString = substr($s, 1);
        } else {
            $testString = substr($s, 0, $i) . substr($s, ($i+1));
        }

        if ($testString == strrev($testString)) {
            $debug && printf('is Palindrome %s' . PHP_EOL, $i);
            $index = $i;
        }

        unset($testString);

        if ($index !== -1) {
            break;
        }
    }

    return $index;
}

